				clicksNum = myGame.length; // עדכון למשתנה לפי כמות השאלות של המשחק
				console.log(myGame); //הצגת המערך
		
				for (i = 0; i < myGame.length; i++) { // לולאה שמעתיקה מהמערך המקורי למערך חדש
					myGametwo[i] = myGame[i]; //התאמת הנתונים בין המערך המקורי למערך החדש
				}
