		function pauseclear() { //פונקציה שמנקה את המסך השהיה
			stage.getChildByName("myPauseicon").addEventListener('click', Pausefunc); // החזרת אירוע לחיצה לאייקון פאוז
			stage.removeChild(stage.getChildByName("myPausescreen")); // הסרת מסך השהייה מהבמה
			stage.removeChild(stage.getChildByName("mypauseanimation")); // הסרת האנימציה על המסך השהייה
		
			stage.removeChild(stage.getChildByName("myNext")); // הסרת כפתור נקסט מהבמה
			myInterval = setInterval(Clocktime, 1000); //קריאה לאינטרבל
		
		}
